import { Link } from "react-router-dom";

export default function Navbar() {
    return (
        <nav className="bg-white border-b px-6 py-3 flex flex-wrap gap-3 justify-center">
            <Link to="/" className="px-5 py-3 rounded-md text-md font-medium hover:bg-gray-100">Accueil</Link>
            <Link to="/actualites" className="px-5 py-3 rounded-md text-md font-medium hover:bg-gray-100">Actualités</Link>
            <Link to="/etat-civil" className="px-5 py-3 rounded-md text-md font-medium hover:bg-gray-100">État Civil</Link>
            <Link to="/demarches" className="px-5 py-3 rounded-md text-md font-medium hover:bg-gray-100">Démarches</Link>
            <Link to="/fiches-pratiques" className="px-5 py-3 rounded-md text-md font-medium hover:bg-gray-100">Fiches Pratiques</Link>
            <Link to="/etranger" className="px-5 py-3 rounded-md text-md font-medium hover:bg-gray-100">Étranger</Link>
        </nav>
    );
}
